import React from 'react';
import "./ModalComponent.css";

const handleModalComponent = () => {
    const element = document.getElementById('ModalComponent');
    element.className = 'ModalComponent_Close';
}

const ModalComponent = ({text}) => {
    return (
        <div id='ModalComponent' className='ModalComponent_Close'>
            <p>{text}</p>
            <button onClick={()=>handleModalComponent()}><i className='fa fa-close'></i></button>
        </div>
    );
}

export default ModalComponent;
